    private View.OnClickListener btnT = new View.OnClickListener() {
        @Override
        public void onClick(View view) {
            String text1 = mEdtText.getText().toString().toLowerCase(Locale.ROOT);
            SpannableString spannableString = new SpannableString(text1);
            if (TextUtils.isEmpty(text1)) {
                mEdtText.setError("Error");
            } else {
                for (int i = 0; i < cuneiforms.length; i++) {
                    int start_index = cuneiforms[i].match(text1);                               //
                    if (start_index == -1) {
                        continue;                                                               //
                    } else {
                        int end_index = start_index + cuneiforms[i].getLanguage().length() - 1;          //
                        String subStr = text1.substring(start_index, end_index+1);                      //
                        text1 = cuneiforms[i].getNewStr(text1,subStr);                               //
                        ImageSpan s = getView(i);                                                //imageSpan
                        spannableString.setSpan(s,start_index,end_index+1, Spannable.SPAN_INCLUSIVE_INCLUSIVE);
                    }
                }
                cuneiform.setText(spannableString);
            }
        }
    };
